import Wordtile from "./wordtile";

class Wordtiles extends Component {
    render() {
        const { wordtiles} =
        this.props;

        console.log("Inside the wordtiles render func")
        console.log(Array.prototype.slice.call(wordtiles))

        return (
        <div>
            {Array.prototype.slice.call(wordtiles).map((wordtile) => (
            <Wordtile
                key={wordtile.id}
                wordtile={wordtile}
            />
            ))}
        </div>
        );
    }
}

export default Wordtiles;
